def collatz_sequence(n):
    """
    Given a positive integer n, return the collatz sequence as a list.
    """
    sequence = [n]
    while n != 1:
        if n % 2 == 0:
            n //= 2
        else:
            n = 3 * n + 1
        sequence.append(n)
    return sequence

